### 4.2.1 Solutions over the group of unitary transformations

The first simplification that is considered is based on the transformation attributes that are required to capture topological conjugacy between two systems. When considering $C \in G L\left(N_{\Psi}\right)$, this implies transformations that will account for rotation, reflection, and stretching. Thus, an important question is whether all three transformation components are necessary? This is addressed in Theorem 1 below.

Theorem 1 If two topologically conjugate systems have discrete spectra with Koopman eigenfunctions scaled such that $\max \left(\Phi_{f, i}\right), \max \left(\Phi_{g, i}\right)=1 \forall i=1 \ldots N_{\Psi}$, then there is a unitary matrix $C \in U\left(N_{\Psi}\right)$ such that $\left\|\Phi_{g}-C \Phi_{f}\right\|_{F}=0$ and $\left\|\Lambda_{f}-C^{-1} \Lambda_{g} C\right\|_{F}=0$.
Proof First, consider that the $i$ th row of $\Phi \in N_{\Psi} \times N_{\Delta t}$ is given by $\phi_{0, i}\left[\lambda_{i} \cdots \lambda_{i}^{N_{\Delta t}}\right]$ where $\phi_{0, i}$ denotes the value of the eigenfunction corresponding to $\lambda_{i}$ at $t=0$. So the rows of $\Phi$ are just simple harmonic signals in discrete time where $\phi_{0, i}$ dictates amplitude and phase while $\lambda_{i}$ dictates decay rate and frequency. With this perspective in mind the term inside the norm operator of Eq. 12 is

$$
\left[\begin{array}{c}
\phi_{0, i} \lambda_{i} \cdots \phi_{0, i} \lambda_{i}^{N_{\Delta t}} \\
\vdots \\
\phi_{0, N_{\Psi}} \lambda_{N_{\Psi}} \cdots \phi_{0, N_{\Psi}} \lambda_{N_{\Psi}}^{N_{\Delta t}}
\end{array}\right]_{g}=C\left[\begin{array}{c}
\phi_{0, i} \lambda_{i} \cdots \phi_{0, i} \lambda_{i}^{N_{\Delta t}} \\
\vdots \\
\phi_{0, N_{\Psi}} \lambda_{N_{\Psi}} \cdots \phi_{0, N_{\Psi}} \lambda_{N_{\Psi}}^{N_{\Delta t}}
\end{array}\right]_{f}
$$

Note that the rows of these matrices will not be aligned since it is assumed the eigensolutions for the two systems are arbitrarily ordered. Since $C$ must be unitary to prove the theorem, $C$ can be set to the composition of matrix $\Theta \in U\left(N_{\Psi}\right)$ and permutation matrix $P \in U\left(N_{\Psi}\right)$, leading to $C=\Theta P$. Note the standard definition of a permutation matrix is one in which the sum of elements in each column is one, the sum in each row is one, and the elements of the matrix can only be one or zero. This results in

$$
\left[\begin{array}{c}
\phi_{0, i} \lambda_{i} \cdots \phi_{0, i} \lambda_{i}^{N_{\Delta t}} \\
\vdots \\
\phi_{0, N_{\Psi}} \lambda_{N_{\Psi}} \cdots \phi_{0, N_{\Psi}} \lambda_{N_{\Psi}}^{N_{\Delta t}}
\end{array}\right]_{g}=\Theta P\left[\begin{array}{c}
\phi_{0, i} \lambda_{i} \cdots \phi_{0, i} \lambda_{i}^{N_{\Delta t}} \\
\vdots \\
\phi_{0, N_{\Psi}} \lambda_{N_{\Psi}} \cdots \phi_{0, N_{\Psi}} \lambda_{N_{\Psi}}^{N_{\Delta t}}
\end{array}\right]_{f}
$$

From Eq. 22, $P$ will permute the rows of the matrix corresponding to system $f$. Without loss of generality, $P$ can be chosen to be the permutation matrix that aligns the rows of the matrix for system $f$ such that the rows for both system matrices correspond to the same eigenvalues. This leads to
$D_{\phi, g} L_{g}=\Theta D_{\phi, f} L_{g}$,
where

$$
\begin{aligned}
& D_{\phi, g}=\left[\begin{array}{c}
\phi_{0, i} \\
\ddots \\
\phi_{0, N}
\end{array}\right]_{g}, D_{\phi, f}=\left[\begin{array}{c}
\phi_{0, i} \\
\ddots \\
\phi_{0, N}
\end{array}\right]_{f} \\
& L_{g}=\left[\begin{array}{c}
\lambda_{i} \cdots \lambda_{i}^{N_{\Delta t}} \\
\vdots \\
\lambda_{N} \cdots \lambda_{N}^{N_{\Delta t}}
\end{array}\right]
\end{aligned}
$$

Therefore the action of $P$ is to align the discrete time signals from Eq. 21 such that the decay rates and frequencies in each row of the system $g$ matrix matches with those in the system $f$ matrix.

The phases between the signals are not yet the same. This is resolved by solving for $\Theta$ from Eq. 23 which gives
$\Theta=D_{\phi, g} D_{\phi, f}^{-1}$.
Since the eigenfunctions have been assumed to have amplitudes equal to one, $\left|\phi_{0, i}\right|=1 \forall i$. As a result, $D_{\phi, g}$ and $D_{\phi, f}$ are unitary which implies $D_{\phi, g} D_{\phi, f}^{-1}$ is unitary by composition properties of groups. Therefore $\Theta$ is unitary and can be interpreted as aligning the phases of the time signals from Eq. 21. Finally, since $\Theta \in U\left(N_{\Psi}\right)$ and $P \in U\left(N_{\Psi}\right)$, then $C \in U\left(N_{\Psi}\right)$ and $\left\|\Phi_{g}-C \Phi_{f}\right\|_{F}=0$ at conjugacy.

Next, consider the operator residual $\left\|\Lambda_{f}-C^{-1} \Lambda_{g} C\right\|_{F}=$ 0 . Assuming that $C$ is unitary, it must be shown that $\left\|\Lambda_{f}-C^{*} \Lambda_{g} C\right\|_{F}=0$ at conjugacy, where the $*$ superscript denotes complex conjugate transpose. Using the Frobenius norm trace identity gives

$$
\begin{aligned}
& \left\|\Lambda_{f}-C^{*} \Lambda_{g} C\right\|_{F}=\operatorname{Tr}\left(\Lambda_{f}-C^{*} \Lambda_{g} C\right)\left(\Lambda_{f}^{*}-C^{*} \Lambda_{g}^{*} C\right) \\
& =\operatorname{Tr}\left(\Lambda_{f} \Lambda_{f}^{*}\right)+\operatorname{Tr}\left(\Lambda_{g} \Lambda_{g}^{*}\right)-2 \operatorname{Tr}\left(C^{*} \Lambda_{g} C \Lambda_{f}^{*}\right)
\end{aligned}
$$

where the cyclic prperty of the trace Tr operation and the trace product identity $\operatorname{Tr}\left(A B^{*}\right)=\operatorname{Tr}\left(B A^{*}\right)$ were used to obtain the second line of Eq. 26. Proceeding in a similar manner as before, it is assumed without loss of generality that $C=\Gamma P$ where $\Gamma, P \in U\left(N_{\Psi}\right)$ and $P$ is the same permutation matrix in Eq. 22 that reorders the eigenvaues of system $f$ to match the ordering of eigenvalues in system $g$, i.e.

$P \Lambda_{f} P^{\mathrm{T}}=\Lambda_{g}$. Substituting $C=\Gamma P$ into the final term of Eq. 26 leads to

$$
\begin{aligned}
& \operatorname{Tr}\left(\Lambda_{f} \Lambda_{f}^{*}\right)+\operatorname{Tr}\left(\Lambda_{g} \Lambda_{g}^{*}\right)-2 \operatorname{Tr}\left(P^{\mathrm{T}} \Gamma \Lambda_{g} \Gamma P \Lambda_{f}^{*}\right) \\
& =\operatorname{Tr}\left(\Lambda_{f} \Lambda_{f}^{*}\right)+\operatorname{Tr}\left(\Lambda_{g} \Lambda_{g}^{*}\right)-2 \operatorname{Tr}\left(\Gamma^{*} \Lambda_{g} \Gamma \Lambda_{g}^{*}\right) \\
& =\sum_{i}\left|\lambda_{f, i}\right|^{2}+\left|\lambda_{g, i}\right|^{2}-2 \lambda_{g_{i}} \bar{\lambda}_{g, i} \Gamma_{i i} \Gamma_{i i} \\
& =2 \sum_{i}\left|\lambda_{g, i}\right|^{2}-2 \lambda_{g_{i}} \bar{\lambda}_{g, i} \Gamma_{i i} \Gamma_{i i}
\end{aligned}
$$

where $\bar{\lambda}_{g, i}$ is the complex conjugate of the $i$ th eigenvalue of system $g$ and $\Gamma_{i i}$ is the complex conjugate of element $(i, i)$ of $\Gamma$. The cyclic property of $\operatorname{Tr}$ and that fact that $P \Lambda_{f}^{*} P^{\mathrm{T}}=\Lambda_{g}^{*}$ were used to obtain the second line of Eq. 27, and Eq. 8 was used to obtain the final line. From the last line of Eq. 27 it is clear that topological conjugacy occurs when $\Gamma_{i i} \Gamma_{i i}=1$. Since $\Gamma$ is unitary, this condition implies $\Gamma$ is any diagonal matrix where each diagonal element has magnitude equal to one. Therefore, the proof of Theorem 1 is completed by choosing $\Gamma=\Theta$ such that the same unitary matrix $C$ satisfies both $\left\|\Lambda_{f}-C^{*} \Lambda_{g} C\right\|_{F}=0$ and $\left\|\Phi_{g}-C \Phi_{f}\right\|_{F}=0$.

Remark 2 Assuming that the amplitudes of the Koopman eigenfunctions are equal to one is not restrictive since Koopman eigenfunctions are not unique [3]; i.e. if $\phi$ is an eigenfunction corresponding to eigenvalue $\lambda$ then $c \phi$ is also an eigenfunction corresponding to $\lambda$ for any constant $c \in \mathbb{C}$.

Remark 3 Theorem 1 shows that it is sufficient to only consider transformations involving rotation and reflection (in $\Phi$-space) to identify that two systems are equivalent. Therefore, it is reasonable to simplify Eq. 18 to

$$
\begin{aligned}
& \min _{C \in U / N_{\Phi} i}\left(r_{1}, r_{2}\right) \\
& r_{1}=\left\|\Phi_{g}-C \Phi_{f}\right\|_{F}, r_{2}=\left\|\Lambda_{f}-C^{*} \Lambda_{g} C\right\|_{F}
\end{aligned}
$$

Theorem 1 implies that Eq. 28 can be expected to be quantitatively accurate when two systems are close to conjugate since stretching is an unnecessary transformation component at conjugacy. Indeed, stretching would be expected to be play a more significant role in precise quantification of deviation when two systems are very far from topological conjugacy. However, in such cases, Eq. 28 would register large values of $r_{1}$ and/or $r_{2}$ thus capturing the relative argument that the two systems are very different from the perspective of topological conjugacy. Thus Eq. 28 is expected to be qualitatively accurate very far from conjugacy.

Remark 4 It is interesting to consider the implication from Theorem 1 that $\Gamma$ must be unitary and diagonal in order to maintain consistency with topological conjugacy. This imples that any unitary diagonal $\Gamma$ will minimize $r_{2}$ since
$(\Gamma P)^{*} \Lambda_{g}(\Gamma P)=P^{*} \Lambda_{g} P$. From a purely mathematical perspective, it is known that the optimal solution for minimizing $r_{2}$ in isolation is a permutation matrix [13]. Similalrly,
taking a spectral operator perspective leads to the same solution as a result of minimizing the Wasserstein distance operating on the Koopman eigenvalues [28,27]. So the the main implication from Theorem 1 that optimal solutions can be found by searching over unitary transformations is in agreement with the solutions from [13] and [28,27] from the perspective of operator level dissimilarity measures. However, Theorem 1 also suggests a more general solution than [13] and $[28,27]$ since $\Gamma$ is effectively a free paramater that can be used to minimize $r_{1}$. Thus, Theorem 1 offers a unified perspective for searching for transformations that minimize both $r_{1}$ and $r_{2}$ simultaneously. This will be exploited for deriving Pareto optimal solutions in Section 4.3.

Remark 5 When solving Eq. 9 and Eq. 10 in $\Psi$-space by restricting $T$ to be unitary(or orthogonal), e.g. [1,14,39,24], the resulting pseudometrics will not yield zero dissimilarity for topologically conjugate systems in general. Since conjugacy residuals satisfy Theorem 1, the pseudometrics in this study will recover zero when $f$ and $g$ are topologically conjugate. Therefore the computational efficiency associated with the approaches in $[1,14,39,24]$ are achieved while maintaining theoretical consistency with topological conjugacy by computing residuals in $\Phi$-space.
